(67, 'mouse', 'LOGITECH MX MASTER 3 (BLACK)', 'เทคโนโลยีเซ็นเซอร์\r\n\r\nDarkfield ที่มีความแม่นยำสูง\r\nค่าที่กำหนด: 1000 dpi\r\nDPI (ค่าต่ำสุดและสูงสุด) 200 dpi ถึง 4000 dpi (สามารถตั้งค่าเพิ่มทีละ 50 dpi)\r\n\r\nปุ่ม\r\n\r\n7 ปุ่ม (คลิกซ้าย/ขวา, ย้อนกลับ/ไปข้างหน้า, การสลับแอป, เปลี่ยนโหมดของล้อ, คลิกกลาง)\r\nล้อเลื่อน: ใช่ มีการเปลี่ยนอัตโนมัติ\r\nล้อเลื่อนสำหรับนิ้วหัวแม่มือ: ใช่\r\nปุ่มท่าทาง: ใช่\r\n\r\nระยะห่างการใช้งานแบบไร้สาย\r\n\r\n10 ม.7\r\n\r\nเทคโนโลยีไร้สาย\r\n\r\nเทคโนโลยีไร้สายที่ก้าวล้ำ 2.4 GHz\r\n\r\nแบตเตอรี่\r\n\r\nแบตเตอรี่ Li-Po (500 mAh) แบบชาร์จไฟได้\r\nชาร์จหนึ่งนาที ใช้ได้สามชั่วโมง5\r\n\r\nซอฟต์แวร์เสริม:\r\n\r\nLogitech Options และ Logitech Flow', '20191102326292253.png', 100, 3590, '2019-11-02 16:12:10'),
(68, 'mouse', 'RAZER NAGA TRINITY GAMING GEAR', 'At a glance\r\n\r\n16,000 DPI 5G optical sensor\r\n3 interchangeable side plates with 2, 7 and 12-button configurations\r\nUp to 19 programmable buttons\r\nEnhanced right-handed form factor\r\nPowered by Razer Chroma™\r\nMulti-Award Winning Razer™ Mechanical Switches\r\nTech Specs\r\n\r\nRazer 5G optical sensor with true 16,000 DPI\r\nUp to 450 inches per second (IPS) / 50 G acceleration\r\n3 interchangeable side plates with 2, 7 and 12-button configurations\r\nUp to 19 independently programmable Hyperesponse buttons\r\nRazer™ Mechanical Mouse Switches\r\nGaming-grade tactile scroll wheel\r\nErgonomic right-handed design with enhanced rubber side grips\r\nRazer Chroma™ lighting with 16.8 million customizable color options\r\n1000 Hz Ultrapolling\r\nRazer Synapse 3 (Beta) enabled\r\nApproximate size: 119 mm / 4.69 in (Length) 74 mm / 2.93 in (Width) 43 mm / 1.69 in (Height)\r\nApproximate weight 120 g / 0.26 lbs (Excluding cable)', '201911021307113050.png', 100, 3590, '2019-11-02 16:12:51'),
(69, 'mouse', 'SURFACE PRECISION XZ ZH KO TH HDWR (LIGHT GRAY)', 'ส่วนติดต่อ: USB 2.1, Bluetooth® พลังงานต่ำ 4.0/4.1/4.2\r\nความถี่ของเครือข่ายไร้สาย: ช่วงความถี่ 2.4 GHz\r\nปุ่ม: 6 ปุ่ม รวมถึงปุ่มคลิกขวาและซ้าย และปุ่มล้อเลื่อน\r\nการออกแบบ: ออกแบบตามหลักการยศาสตร์ พร้อมกริปด้านข้าง\r\nการเลื่อน: เลื่อนแนวนอนและแนวตั้งในแบบต่อเนื่องหรือแบบฝืดแม่เหล็ก สามารถกำหนดเองได้1\r\nสี: เทา\r\nขนาด: 4.8 x 3.05 x 1.7 (122.6 มม. x 77.6 มม. x 43.3 มม.)\r\nน้ำหนัก: 4.76 ออนซ์ (135 กรัม) รวมแบตเตอรี่แบบชาร์จได้\r\nแบตเตอรี่: แบตเตอรี่ลิเธียมไอออนแบบชาร์จได้ (มีให้)\r\nอายุแบตเตอรี่: สูงสุด 3 เดือน\r\nความเข้ากันได้: Windows 10 Home, Windows 10 Pro, Windows 8.1 – กำหนดเองได้เต็มรูปแบบ\r\nWindows 10 S1, Windows 7 (โหมด USB เท่านั้น, มีสายให้), Mac OSX1\r\nหากต้องการใช้ในโหมดไร้สาย อุปกรณ์โฮสต์ต้องรองรับ Bluetooth® 4.0 หรือสูงกว่า\r\n(หมายเหตุ: อุปกรณ์ Apple และ Windows 7 หลายรุ่นไม่รองรับเวอร์ชันเหล่านี้)\r\nการกำหนดปุ่ม1 และการสลับใช้งานแบบอัจฉริยะ2 จะใช้ได้ก็ต่อเมื่อใช้ซอฟต์แวร์ศูนย์เมาส์และแป้นพิมพ์เท่านั้น ไม่สามารถใช้งานได้ใน Windows 10 S หรือ Mac OSX\r\nการรับประกัน: รับประกันฮาร์ดแวร์ภายใต้เงื่อนไข 1 ปี', '20191102749439893.png', 100, 3590, '2019-11-02 16:16:39'),
