(73, 'keyboard', 'HyperX ALLOY ELITE RGB (CHERRY MX BROWN) (RGB LED)', 'สวิตช์ : CHERRY MX\r\nประเภท : ชิ้นส่วน\r\nไฟพื้นหลัง : RGB\r\nเอฟเฟกต์แสง : โหมด LED 6 โหมด ปรับความสว่างได้ 4 ระดับ\r\nประเภทการเชื่อมต่อ : USB 2.0 (หัวต่อ USB 2 หัว)\r\nUSB 2.0 Pass-through : ใช่\r\nอัตราการโพลล์ : 1000Hz\r\nAnti-ghosting : 100% anti-ghosting\r\nKey Rollover : โหมด N-key\r\nการควบคุมสื่อมีเดีย : ใช่\r\nโหมดเกม : ใช่\r\nการรองรับการทำงานกับ OS : Windows® 10, 8.1, 8, 7', '20191102295688359.png', 100, 5290, '2019-11-02 16:27:58'),
(74, 'keyboard', 'LOGITECH G G913 LIGHTSPEED WIRELESS RGB (GL CLICKY', 'คุณสมบัติทางกายภาพ\r\n\r\nความยาว: 475 มม.\r\nความกว้าง: 150 มม.\r\nความสูง: 22 มม.\r\nน้ำหนัก (ไม่รวมสายเคเบิล): 1025 กรัม\r\nความยาวสายเคเบิลพีซี: 6 ฟุต\r\nข้อกำหนดด้านเทคนิค\r\n\r\nสวิตช์ GL โครงต่ำ:\r\n\r\nระยะห่างการเรียกใช้งาน: 1.5 มม.\r\nแรงในการเรียกใช้งาน: 50 g\r\nระยะห่างการเคลื่อนที่รวม: 2.7 มม.\r\nอายุแบตเตอรี่:\r\n\r\n30 ชั่วโมง (ความสว่าง 100%)\r\n\r\nหน่วยความจำออนบอร์ด:\r\n\r\n2 โปรไฟล์แสง\r\n3 โปรไฟล์มาโครแบบ G-Keys\r\nคุณสมบัติอื่นๆ:\r\n\r\nระบบไร้สาย LIGHTSPEED\r\nBluetooth®\r\nLIGHTSYNC RGB ต่อแสงในแต่ละปุ่ม\r\nG-Key 5 ปุ่มที่ออกแบบมาโดยเฉพาะ\r\nส่วนควบคุมมีเดียที่ออกแบบมาโดยเฉพาและล้อระดับเสียงที่ไร้ขอบ\r\nข้อกำหนด\r\n\r\nLIGHTSPEED: พอร์ต USB และ Windows® 7 หรือสูงกว่า macOS® X 10.11 หรือสูงกว่า\r\nBluetooth®: อุปกรณ์ที่เปิดใช้งาน Bluetooth® ที่มี Windows® 8 หรือสูงกว่า, macOS® X 10.11 หรือสูงกว่า, Chrome OS™ หรือ Android™ 4.3 หรือสูงกว่า iOS 10 หรือสูงกว่า\r\n(เสริม) การเข้าถึงอินเทอร์เน็ตสำหรับซอฟต์แวร์ Logitech G HUB4ฟีเจอร์ขั้นสูงต้องใช้ Logitech G HUB Gaming Software ซึ่งพร้อมสำหรับการดาวน์โหลดที่ logitechg.com/GHUB', '201911021548258958.png', 100, 5020, '2019-11-02 16:29:15'),
(75, 'keyboard', 'RAZER HUNTSMAN (MERCURY WHITE) (RAZER OPTO-MECHANI', 'At a glance\r\n\r\nNew Razer Opto-Mechanical Switch™ – Light and Clicky\r\nKey stabilizer bar for precise, balanced actuation\r\nHybrid on-board memory and cloud storage\r\nUp to 100 million keystrokes\r\nRazer Chroma™ backlighting\r\nTech Specs\r\n\r\nRazer™ Opto-Mechanical Switch with 45 G actuation force\r\n100 million keystroke lifespan\r\nChroma backlighting with 16.8 million customizable color options\r\nHybrid onboard storage – up to 5 profiles\r\nRazer Synapse 3 enabled\r\nFully programmable keys with on-the-fly macro recording\r\n10 key roll-over with anti-ghosting\r\nGaming mode option\r\nBraided Fiber Cable\r\n1000 Hz Ultrapolling\r\nAluminum matte top plate\r\nCompatible with Xbox One for basic input', '201911021426763562.png', 100, 5790, '2019-11-02 16:29:58'),
(76, 'keyboard', 'RAZER HUNTSMAN ELITE (OPTO MECHANICAL SWITCH) (RGB', 'Razer™ Opto-Mechanical Switch with 45 G actuation force\r\n100 million keystroke lifespan\r\nChroma backlighting with 16.8 million customizable color options\r\nUnderglow lighting with 38 customization zones\r\nErgonomic Wrist Rest with 20 customization zones underglow\r\nMulti-functional digital dial\r\nDedicated media controls\r\nHybrid onboard storage – up to 5 profiles\r\nRazer Synapse 3 enabled\r\nFully programmable keys with on-the-fly macro recording\r\n10 key roll-over with anti-ghosting\r\nGaming mode option\r\nBraided Fiber Cable\r\n1000 Hz Ultrapolling\r\nAluminum matte top plate', '201911021855727495.png', 100, 8290, '2019-11-02 16:30:30'),
(77, 'keyboard', 'ROCCAT RYOS MK PRO (RED SWITCH) (BLUE LED) (EN TH)', 'Per-key illuminated mechanical keyboard with 113 keys\r\nAdvanced anti-ghosting with N-key rollover\r\nChoice of four CHERRY MX key switches\r\n3 programmable thumbster keys\r\n5 programmable macro keys\r\n94 other programmable keys\r\n1000Hz polling rate\r\n1ms response time\r\n1.8m braided USB cable', '201911021659340871.png', 100, 5390, '2019-11-02 16:31:08'),
(78, 'allaccessories', 'GOOGLE CONNECTOR WIRELESS CHROMECAST GEN 3', 'สตรีมภาพคมชัด ระดับ Full HD 1080P/60fps\r\nรองรับ WiFi 2.4/5.0 GHz\r\nMirror หน้าจอจาก Laptop(ผ่านบราวเซอร์Chrome)\r\nรองรับการใช้งานกับ Android/iOS, Mac/Windows, Tablet\r\nใช้งานง่ายเพียงแค่เสียบสายเข้ากับ TV และเชื่อมต่อ Wifi', '201911021361784580.png', 100, 2390, '2019-11-02 16:37:36'),
(79, 'allaccessories', 'LOGITECH HD C615', 'HD 720p up to 1080p', '201911021864751867.png', 100, 2690, '2019-11-02 16:40:50'),
(80, 'allaccessories', 'LOGITECH SPOTLIGHT (GOLD) WIRELESS CORDLESS DIGITA', 'ชนิดการเชื่อมต่อ: การเชื่อมต่อไร้สาย Bluetoothและ 2.4GHz\r\nระยะการเชื่อมต่อไร้สาย: 30 เมตร*\r\n* อาจแตกต่างกันไป ขึ้นอยู่กับสภาวะการใช้งานและการประมวลผล\r\n\r\nไฟสัญญาณ (LED): ไฟสัญญาณ LED สำหรับแบตเตอรี่และการเชื่อมต่อ\r\nรายละเอียดแบตเตอรี่: ลิเธียมโพลีเมอร์แบบชาร์จไฟได้, 85mAh\r\nอายุแบตเตอรี่ (ชาร์จไฟได้): 3 เดือน*\r\n* อาจแตกต่างกันไป ขึ้นอยู่กับสภาวะการใช้งานและการประมวลผล\r\n\r\nความยาวของสายเชื่อมต่อ: 140 มม.\r\nเซ็นเซอร์: เซ็นเซอร์วัดความเร่ง 3D และไจโรสโคป\r\nเทคโนโลยีเซ็นเซอร์: เซ็นเซอร์ตรวจจับการเคลื่อนไหว', '20191102838005498.png', 100, 3590, '2019-11-02 16:41:21'),
(81, 'allaccessories', 'MICROSOFT WIRELESS DISPLAY ADAPTER V2 MCS-P3Q-0001', 'คุณสมบัติ\r\n\r\nความยาวของอะแดปเตอร์: 103.5 x 22 x 11 mm\r\nความยาวของสาย: 300mm\r\nพร้อมสายต่อขยาย USB ยาว: 159mm\r\nระบบปฏิบัติการ\r\n\r\nWin 10 64 bit\r\nWin 10 32 bit\r\nWin 8.1 32 bit\r\nWin 8.1 64 bit', '20191102818364293.png', 100, 2490, '2019-11-02 16:41:52'),
